import React, { Component } from 'react';

export default class Box extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        const p = ['01','11','21','31','41','51','61','71','60','61','62','63','64','65','66','67']
        const t = ['00','70','07','77']
        const c = ['10','60','17','67']
        const a = ['02','05','72','75']
        const q = ['03','74']
        const k = ['04','75']

        return(
            <div 
                id={this.props.id}
                className={"Box w-12 h-12 text-center "+this.props.color} > 
                {p.map((coo)=>{
                    if(coo==this.props.coo){ return'p' }
                })}
                {t.map((coo)=>{
                    if(coo==this.props.coo){ return't' }
                })}
                {c.map((coo)=>{
                    if(coo==this.props.coo){ return'c' }
                })}
                {a.map((coo)=>{
                    if(coo==this.props.coo){ return'a' }
                })}
                {q.map((coo)=>{
                    if(coo==this.props.coo){ return'q' }
                })}
                {k.map((coo)=>{
                    if(coo==this.props.coo){ return'k' }
                })}
            </div>
        );
    }
}
